-- These commands create the required database for our Dog Walker app

-- drop database if it exits
drop database dogwalker;


-- create the database;
create database dogwalker;

-- connect to the database. Note: you need to on the cli psql
\c dogwalker;

-- now create the main tables.

CREATE table credentials (
    credential_id SERIAL PRIMARY KEY NOT NULL,
    credential_email VARCHAR(20) NOT NULL,
    credential_password VARCHAR(20) NOT NULL,
    credential_type VARCHAR(1) NOT NULL
);


-- create the services
CREATE TABLE services (
    service_id SERIAL PRIMARY KEY NOT NULL,
    service_type VARCHAR(4) NOT NULL,
    service_fee NUMERIC(4,2) NOT NULL
);

-- SERVICES DATA

-- CREATE TABLE OWNERS
CREATE TABLE owners (
owner_id SERIAL PRIMARY KEY NOT NULL,
owner_firstname VARCHAR(20) NOT NULL,
owner_lastname VARCHAR(20) NOT NULL,
owner_street_address VARCHAR(50) NOT NULL,
owner_town VARCHAR(50) NOT NULL,
owner_postcode INTEGER NOT NULL,
owner_mobile VARCHAR(10) NOT NULL,
owner_email VARCHAR(20) NOT NULL,
owner_dob DATE NOT NULL,
owner_licence_photo VARCHAR(100),
owner_overall_rating NUMERIC,
owner_active_membership BOOLEAN DEFAULT TRUE,
UNIQUE (owner_email),
UNIQUE (owner_mobile)
);


-- OWNERS DATA




-- THIS TABLE CREATE DOGS
CREATE TABLE dogs (
dog_id SERIAL PRIMARY KEY NOT NULL,
dog_firstname VARCHAR(20) NOT NULL,
dog_photo VARCHAR(100) NOT NULL,
dog_breed VARCHAR(20) NOT NULL,
dog_size VARCHAR(1) NOT NULL,
dog_always_leashed BOOLEAN DEFAULT TRUE,
owner_id INTEGER,
FOREIGN KEY (owner_id) REFERENCES owners(owner_id)
);


-- DOGS DATA

SELECT count(*) FROM dogs;




-- THIS TABLE CREATES THE WALKERS TABLE
CREATE TABLE walkers (
    walker_id SERIAL PRIMARY KEY NOT NULL,
    walker_firstname VARCHAR(20) NOT NULL,
    walker_lastname VARCHAR(20) NOT NULL,
    walker_street_address VARCHAR(50) NOT NULL,
    walker_town VARCHAR(50) NOT NULL,
    walker_postcode INTEGER NOT NULL,
    walker_mobile VARCHAR(10) NOT NULL,
    walker_email VARCHAR(20)  NOT NULL,
    walker_dob DATE NOT NULL,
    walker_licence_photo VARCHAR(100),
    walker_overall_rating NUMERIC,
    walker_dog_size_preference VARCHAR(1) NOT NULL,
    walker_30WO INTEGER,
    walker_60WO INTEGER,
    walker_30HV INTEGER,
    walker_60HV INTEGER,
    walker_active_membership BOOLEAN DEFAULT TRUE,
    UNIQUE (walker_email),
    UNIQUE (walker_mobile)
);


-- WALKER dATA



-- create the bookings
CREATE TABLE bookings (
    booking_date DATE NOT NULL,
    booking_start_time BIGINT NOT NULL,
    booking_end_time BIGINT NOT NULL,
    booking_duration INTEGER NOT NULL,
    booking_photo_proof VARCHAR(100),
    booking_gps_image VARCHAR(100),
    booking_service_fee NUMERIC(8,2) NOT NULL,
    booking_our_comission NUMERIC(8,2) NOT NULL,
    booking_cancelled BOOLEAN DEFAULT FALSE,
    booking_whom_cancelled VARCHAR(20),
    booking_status VARCHAR(1),
    service_id INTEGER,
    FOREIGN KEY (service_id) REFERENCES services(service_id),
    dog_id INTEGER,
    FOREIGN KEY (dog_id) REFERENCES dogs(dog_id),
    owner_id INTEGER,
    FOREIGN KEY (owner_id) REFERENCES owners(owner_id),
    walker_id INTEGER,
    FOREIGN KEY (walker_id) REFERENCES walkers(walker_id) 
);





